    const [id] = useState<number>(new Date().getTime());
    const [pokemon] = useState<Pokemon>(new Pokemon(id));

    return (
        <div>
            <h2 className="header center">Ajouter un pok√©mon</h2>
            <PokemonForm pokemon={pokemon}></PokemonForm>
        </div>
    );
}

export default PokemonAdd;
